import React from 'react'
import Axios from 'axios'
import { userId } from './Login'

let aloot

const getTasks = (userId) => {
  Axios.post('http://localhost:3001/api/retriveTasks', {
    userId: userId,
  }).then((e) => {
    console.log(e['data'])
    aloot = e['data']
  })
}

aloot = getTasks(1)
console.log(aloot)

const notes = [
  {
    id: 1,
    name: 'task1',
    description: 'desc1',
    date: '18/5/2022',
  },
  {
    id: 2,
    name: 'task2',
    description: 'desc2',
    date: '19/5/2022',
  },
]

export { notes }
